    "contracts/BSCToken.sol": {
      "content": "//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.9;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import 'hardhat/console.sol';
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract SBCToken is ERC20, Ownable {
    using SafeMath for uint;
    mapping(address => bool) public swapPairs;
    uint256 public buyFee = 100;
    uint256 public sellFee = 100;
    uint256 private _totalFee = 0;
    mapping(address => bool) public excludedFee;
    address public feeAddress;
    address otherTokenAddress;
    address public mainPair;
    address private _DeadAddress = 0x000000000000000000000000000000000000dEaD;


    //
    constructor(address _usdtAddress, address _iUniswapV2Router02Add, address _feeAddress) public ERC20("SBC", "SBC") {
        IUniswapV2Router02 iUniswapV2Router02 = IUniswapV2Router02(
            _iUniswapV2Router02Add
        );
        IUniswapV2Factory iUniswapV2Factory = IUniswapV2Factory(
            iUniswapV2Router02.factory()
        );
        address pair1 = iUniswapV2Factory.createPair(
            address(this),
            iUniswapV2Router02.WETH()
        );
        
        address pair2 = iUniswapV2Factory.createPair(
            address(this),
            _usdtAddress
        );
        mainPair = pair2;
        swapPairs[pair1] = true;
        swapPairs[pair2] = true;
        excludedFee[msg.sender] = true;
        excludedFee[_DeadAddress] = true;
        feeAddress = _feeAddress;
        otherTokenAddress = _usdtAddress;
        _mint(msg.sender, 2100 * 10000 * 10 ** uint256(decimals()));

    }
    function decimals() public view virtual override returns (uint8) {
        return 18;
    }
    function totalFee() public view returns (uint256) {
        return _totalFee;
    }

    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        _customTransfer(_msgSender(), recipient, amount);
        return true;
    }

    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) public virtual override returns (bool) {
        address spender = _msgSender();
        uint256 tAmount = _customTransfer(from, to, amount);
        _spendAllowance(from, spender, tAmount);
        return true;
    }
    //
    function _customTransfer(address sender, address recipient, uint256 amount) private returns (uint256) {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        bool isSwap = swapPairs[sender] || swapPairs[recipient];
        uint256 tAmount = amount;
        if (isSwap) {
            //buy
            if (swapPairs[sender]) {
                if(!excludedFee[recipient])
                {
                    uint256 buyFeeAmount = amount.mul(buyFee).div(100);
                    _totalFee += buyFeeAmount;
                    tAmount = amount.sub(buyFeeAmount);
                    if(buyFeeAmount > 0){
                        _transfer(sender, feeAddress, buyFeeAmount);
                    }
                }
            }
            //sell
            if (swapPairs[recipient]) {
                if(!excludedFee[sender])
                {
                    uint256 sellFeeAmount = amount.mul(sellFee).div(100);
                    _totalFee += sellFeeAmount;
                    tAmount = amount.sub(sellFeeAmount);
                    if(sellFeeAmount > 0){
                        _transfer(sender, feeAddress, sellFeeAmount);
                    }
                }
            }
        }
        _transfer(sender, recipient, tAmount);
        return tAmount;
    }

    function _isAddLiquidity() internal view returns (bool isAdd) {
        IUniswapV2Pair pair = IUniswapV2Pair(mainPair);
        (uint r0, uint256 r1, ) = pair.getReserves();

        address tokenOther = otherTokenAddress;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }
        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isAdd = bal > r;
    }

    function _isRemoveLiquidity() internal view returns (bool isRemove) {
        IUniswapV2Pair pair = IUniswapV2Pair(mainPair);
        (uint r0, uint256 r1, ) = pair.getReserves();

        address tokenOther = otherTokenAddress;
        uint256 r;
        if (tokenOther < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(tokenOther).balanceOf(address(mainPair));
        isRemove = r >= bal;
    }
    function updateBuyFee(uint _buyFee) public onlyOwner{
        buyFee = _buyFee;
    }

    function updateSellFee(uint _sellFee) public onlyOwner{
        sellFee = _sellFee;
    }
    function updateFeeAddress(address _feeAddress) public onlyOwner{
        feeAddress = _feeAddress;
    }
    function addSwapPair(address pairAddress) public onlyOwner {
        swapPairs[pairAddress] = true;
    }
    function appendExcludedFee(address account) public onlyOwner {
        excludedFee[account] = true;
    }
    function removeExcludedFee(address account) public onlyOwner {
        excludedFee[account] = false;
    }

    function removeSwapPair(address pairAddress) public onlyOwner {
        swapPairs[pairAddress] = false;
    }

}"
    },
